import React from "react";
import aboutImg1 from "../images/Services/ourteam.jpg";
import aboutImg2 from "../images/Services/project4.jpg";
import aboutImg3 from "../images/Services/project5.jpg";
import "./About.css";

function About() {
  return (
    <div className="about-root about-grid">
      <div className="about-card">
        <img src={aboutImg1} alt="About Gajulapalli Infra" className="about-card-img" />
        <h1 className="about-title">About Gajulapalli Infra</h1>
        <p className="about-text">Gajulapalli Infra and Constructions has been a leader in the construction industry for over 20 years, delivering high-quality residential, commercial, and industrial projects across the region.</p>
      </div>
      <div className="about-card">
        <img src={aboutImg2} alt="Our Mission" className="about-card-img" />
        <h2 className="about-section-title">Our Mission</h2>
        <p className="about-text">To build lasting relationships with our clients by delivering exceptional construction solutions with integrity, innovation, and excellence.</p>
      </div>
      <div className="about-card">
        <img src={aboutImg3} alt="Our Values" className="about-card-img" />
        <h2 className="about-section-title">Our Values</h2>
        <ul className="about-list">
          <li>Quality Craftsmanship</li>
          <li>Customer Satisfaction</li>
          <li>Timely Delivery</li>
          <li>Safety First</li>
          <li>Innovation</li>
          <li>Transparency</li>
        </ul>
      </div>
    </div>
  );
}

export default About;
